//         console.log("Connected to mongodb");
//         app.listen(3001, () => {
//             console.log("Node API app us running on port 3001");
//             fetch(GET)
//                 .then(response => {
//                     return response.json();
//                 })
//                 .then(d => {
//                     console.log(d);
//                 })
//         })
//     }).catch((error) => {
//         console.log(error);
//     });

class ClubMembers extends Component {

    // constructor() {
    //     super();
    //     this.state = {
    //         _id: [{}],
    //         clubName: [{}],
    //         memberName: [{}],
    //         ageGroup: [{}],
    //         crewType: [{}],
    //         createdAt: [{}],
    //         updatedAt: [{}],
    //         __v: [{}],
    //     }
    // }
    // componentDidMount() {
    //     fetch(GET)
    //         .then(response => {
    //             return response.json();
    //         })
    //         .then(d => {
    //             this.setState({ clubName: d });
    //             console.log(this.state.clubName);
    //         })
    // }

    render() {
        return (
            <>
                <Header />
                <div className='back-button'>
                    <LinkButtonBlack
                        text="< Back"
                        onClick={onBackButtonClick}
                    />
                </div>
                <div className='content-container'>
                    <h1 className='h2'>Club members</h1>
                    <div className='club-table-container'>
                        <table>
                            <tbody>
                                <tr>
                                    <td className='addMemberCell'>
                                        <LinkButtonBlack
                                            text="+ Add member"
                                            onClick={onAddMemberButtonClick}
                                        />
                                    </td>
                                </tr>
                                <tr className='table-header'>
                                    <th>Rower name</th>
                                    <th>Age group</th>
                                    <th>Crew type</th>
                                </tr>
                                <tr>
                                    <td>{renderList().memberName}</td>
                                    <td>{renderList().ageGroup}</td>
                                    <td>{renderList().crewType}</td>
                                    <td>
                                        <LinkButtonBlack
                                            text="View >"
                                            onClick={onViewMemberButtonClick}
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <td>{renderList().memberName}</td>
                                    <td>{renderList().ageGroup}</td>
                                    <td>{renderList().crewType}</td>
                                    <td>
                                        <LinkButtonBlack
                                            text="View >"
                                            onClick={onViewMemberButtonClick}
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <td>{renderList().memberName}</td>
                                    <td>{renderList().ageGroup}</td>
                                    <td>{renderList().crewType}</td>
                                    <td>
                                        <LinkButtonBlack
                                            text="View >"
                                            onClick={onViewMemberButtonClick}
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <td>{renderList().memberName}</td>
                                    <td>{renderList().ageGroup}</td>
                                    <td>{renderList().crewType}</td>
                                    <td>
                                        <LinkButtonBlack
                                            text="View >"
                                            onClick={onViewMemberButtonClick}
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <td>{renderList().memberName}</td>
                                    <td>{renderList().ageGroup}</td>
                                    <td>{renderList().crewType}</td>
                                    <td>
                                        <LinkButtonBlack
                                            text="View >"
                                            onClick={onViewMemberButtonClick}
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <td>{renderList().memberName}</td>
                                    <td>{renderList().ageGroup}</td>
                                    <td>{renderList().crewType}</td>
                                    <td>
                                        <LinkButtonBlack
                                            text="View >"
                                            onClick={onViewMemberButtonClick}
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <td>{renderList().memberName}</td>
                                    <td>{renderList().ageGroup}</td>
                                    <td>{renderList().crewType}</td>
                                    <td>
                                        <LinkButtonBlack
                                            text="View >"
                                            onClick={onViewMemberButtonClick}
                                        />
                                    </td>
